,'武汉音乐学院通俗演唱会','参加武汉音乐学院通俗演唱会','2007-06-13',0),(237,201,'宋祖英《好一朵美丽的茉莉花》个人音乐会','在美国华盛顿肯尼迪艺术中心，担任宋祖英《好一朵美丽的茉莉花》个人音乐会表演嘉宾。','2006-10-13',0),(238,201,'双拥晚会','参加双拥晚会 。','2006-12-01',0),(239,201,'2006深圳电台971全国原创歌曲评选','荣获2006深圳电台971全国原创歌曲评选“年度飞越大奖”','2007-01-01',0),(240,201,'中央电视台春节晚会、春节歌舞晚会、外交部文艺晚会等','参加中央电视台春节晚会、春节歌舞晚会、外交部文艺晚会等','2007-02-01',0),(241,201,'《唱山歌》栏目“姚贝娜个人专场”演唱会','录制了《唱山歌》栏目“姚贝娜个人专场”演唱会','2007-03-01',0),(242,208,'江苏省第十六届运动会闭幕式大型文艺晚会','参加江苏省第十六届运动会闭幕式大型文艺晚会。\r\n2006-11-03\r\n　　 本报南通电(记者 单昊 通讯员王建波)昨晚的南通体育会展中心花团锦簇，万众欢腾，江苏省第十六届运动会在隆重热烈的颁奖仪式和欢乐喜庆的大型文艺晚会《星夜无眠》中徐徐落下帷幕。在此次省运会上，我市体育健儿奋力拼搏，取得了优异的成绩，还有5项成绩打破省年龄组记录。据统计，我市一共获得33.5枚金牌、31枚银牌、24枚铜牌，总积分1,227.5分，超过了上届的1163.5分，完成了预期任务。\r\n　　闭幕式晚会将夜空里星星的璀璨、神秘呈现在观众的面前。全场演出由“凯旋”、“心愿”、“祝福”、“告别”四大版块组成，将本次运动会演绎成一个充满温馨与柔情的盛会，将主办地南通永久地留在每一个人的记忆里。另外，晚会还从“星的璀璨、星的深邃、星的唯美和星的浪漫”四个角度解构了“星夜无眠”这一主题。专门为十六运创作的两歌一词（《美丽的南通，多好的家》、《这里通向未来》、《美丽颂歌———献给江苏省第十六届运动会闭幕式》）将闭幕式晚会推向了高潮。\r\n　　据介绍，本届省运会首次以申办方式确定承办地，是我省举办的规模最大、项目最全、参赛人数最多的一届省运会，也是我省备战2008年奥运会的一次大练兵和大检阅。本届省运会共设青少年、高校和职工三个部，比赛大项63个，参赛运动员超过14000人。最终南京市以265金、139银、147铜高居奖牌榜首位，苏州市以178.5金、115银、107铜列第二，东道主南通市以170.5金、97.5银、92.5铜位列第三。\r\n　　我市代表队在此次省运会上共参加了24个大项的100多个小项的比赛，港城健儿摘取了金牌35.5枚、银牌31枚、铜牌24枚，总积分达到1,227.5分，完成了赛前提出的目标任务。\r\n　　2010年第十七届省运动会将在常州举行。','2006-11-02',0),(243,201,'纪念中国共产党成立八十五周年','参加《永远跟您走》纪念中国共产党成立八十五周年大型专题文艺晚会。','2006-06-26',0),(244,201,'第十二届青歌赛通俗唱法决赛第一场.rar','参加“隆力奇杯”第十二届CCTV青年歌手大奖赛，获得通俗唱法个人单项的亚军','2006-08-01',0),(245,201,'第十二届CCTV青年歌手大奖赛 – 小品','在青歌赛举办的“最受观众喜爱的歌手评选活动”晚会上反串方言小品《罚款》，之后又在《新视听》栏目多次反串经典小品《吃面条》，《胡椒面》、《主角与配角》、《追星族》等，展现了其卓越的表演天赋。','2006-08-06',0),(246,201,'央视《欢乐中国行》《中华情》等','多次参加中央电视台多个品牌栏目录制。先后随《欢乐中国行》《中华情》参加荣城，鞍山，南通等地演出。','2006-01-01',0),(247,201,'第五届中国金唱片颁奖晚会','参加第五届中国金唱片颁奖晚会。','2006-01-01',0),(248,201,'2006电影人新春大联欢','参加CCTV-6“2006电影人新春大联欢”晚会录制。','2006-01-27',0),(249,201,'“大地飞歌”南宁国际民歌艺术节开幕晚会','连续两年参加“大地飞歌”南宁国际民歌艺术节开幕晚会。','2006-01-01',0),(250,201,'金沙成都首演','出演中国首部大型原创音乐剧《金沙》女主角‘金’。与沙宝亮合作，共同成为第一任男女主演。该剧在成都试演，北京首演后，获得了界内的首肯和好评。著名音乐人总导演兼作曲三宝对姚贝娜的实力与潜质给予了好评及充分肯定。因为出演了该剧也为姚贝娜奠定了在音乐界的基础。大型音乐剧《金沙》投入1600多万元排演，其中360多套精美的服饰花掉上百万元。深圳女孩姚贝娜凭扎实的音乐功底征服著名音乐人三宝，出演该剧女主角。该剧作曲兼总导演三宝在昨晚首演后哭了，为音乐剧“蓄须明志”三个月的他含着泪对演员们说：“我现在特别有信心，先不说轰动，但大家一定会喜欢看！” 　　《金沙》在“新”上下了很多功夫，新的音乐，号称“国内最先进”的舞台技术，新               鲜的故事，可以让观众看到国内音乐剧中最为先锋的东西。 　　深圳女孩姚贝娜挑起大梁演主角 　　三宝音乐剧《金沙》一举成功 　　由著名音乐家三宝担任总导演兼作曲的大型音乐剧《金沙》昨夜在成都正式演出，深圳女孩姚贝娜挑起女一号大梁，演出大获成功。演出结束后，本报记者第一时间电话连线姚贝娜，电话那头，正在卸妆的姚贝娜，兴奋地与记者聊起了音乐剧《金沙》。她说，她与四川歌手谭维维被三宝分别确定为女主角的A角与B角。《金沙》将于4月8、9、10日在北京保利剧院公演，到时候，姚贝娜的搭档可能是现在的张博，也可能是沙宝亮。 　　出演女一号神鸟 　　深圳女孩姚贝娜是中国音乐学院声乐歌剧系大五学生，24岁，身高1.68米，漂亮。能够在三宝的大型音乐剧《金沙》里出演女主角，实在是一件太幸运的事情，因为三宝的作品让不少歌手一夜走红。 　　音乐剧《金沙》是为世界重大考古发现成都“金沙遗址”量身定做的。“这是一部充满神话色彩但又有很多时尚元素而且十分惟美的音乐剧。”姚贝娜边说边搜索形容词来赞誉该剧。她在剧中扮演女主角金，金是一只神鸟，与挖掘“金沙遗址”的当代考古学家沙在3000年前是一对恋人。3000年来，金一直爱着沙，但已经成为凡人的沙，显然是没有记忆了，为了唤起沙的记忆，金开始了惟美而又深情的演唱，一段跨越时空的爱情故事开始回溯…… 　　姚贝娜在音乐剧中共演唱14首歌曲。她说：“三宝老师的音乐太美了，旋律简单又好听，时而柔，时而刚，时而如泣如诉，时而雄浑激昂，时而诙谐活泼，而且编剧关山的词写得也特别简练、通俗。”谈起角色金，姚贝娜说表演起来并没有感到难度很大，自今年1月开始排练以来，她已经对角色心领神会，并融入得很深。她说：“金是个神鸟的化身，大气、内敛、圣洁又有威仪的女性。自己在表演时很入戏，也很享受。” 　　征服了挑剔的音乐人三宝 　　三宝对歌手的挑剔历来严格。姚贝娜靠什么征服了三宝呢？姚贝娜说，2004年12月，《金沙》开始筹备，在全国选演员，她去了。面试时，三宝让她唱了《金沙》中的选段，三宝感觉她处理歌曲很到位，嗓音纯正、自然，一点儿不复杂，她就这样就被选中了。记者说：“这可能让你一夜走红。”而姚贝娜却说：“我对走不走红并不感兴趣，只是希望能够做自己喜欢的音乐。” 　　台上一分钟，台下10年功。姚贝娜之所以一下子被三宝看中，完全取决于她扎实的音乐功底。姚贝娜中学时就被父母送进武汉音乐学院附中，师从汤灿的老师冯家慧。考入中国音乐学院学习民族声乐，但姚贝娜又酷爱通俗音乐。早在2002年上大二时，她就回到深圳，在第11届广东省运动会的开幕式和闭幕式上，演唱了那首轻松活泼的歌曲《广东步步高》。2003年，她又在文化部主办的“全国声乐新人新作比赛”中获得了二等奖。此后又回到深圳演唱了由唐跃生作词、陈小奇作曲的《梧桐烟雨》，获得一致好评。 　　复活了富庶的蜀都风情 　　与姚贝娜在电话里聊了10多分钟，当话题重新回到三宝的音乐剧《金沙》上时，姚贝娜的兴奋依然没有丝毫的减退。记者问：“除了音乐和故事是该剧的魅力所在，你认为还有什么让你感动呢？”姚贝娜的语言很有色彩，她说：“舞台美轮美奂，充满神秘气息，我在演出时完全可以感受到：一个绮丽富庶、温柔多情的古蜀王国被复活了，加上剧情穿越时空，把古典与现代并蓄的成都风情演绎得如诗如画。” 　　记者了解到，制作单位投入了1600多万元来排演音乐剧《金沙》，其中360多套精美的服饰就花掉了上百万元。姚贝娜说，她在剧中共有3套服装，或如翠鸟、或如白衣仙女、或如青莲花仙，姿态绰约。此外，音乐剧还配有充满金沙神秘色彩的布景，以及美轮美奂的3D动画背景：透明的象牙灯、剪纸艺术制作的成都街道牌坊、光色斑斓的陨石飞船、可自由升降的巨型乌木、幽静茂密的水草丛……在多变的背景中，演绎着古蜀王都、金沙夜色、远古战场 ','2005-05-22',0),(251,201,'中法教育展','赴法国参加中、法两国教育展，并为当地华人华侨高校学生等各界人士演出。','2003-10-01',0),(252,201,'与香港大学生联合演出','参加由北京市教委组织赴香港与当地大学生联合演出。','2003-11-01',0),(253,201,'深圳首届国际时装周开幕式晚会','参加深圳首届国际时装周开幕式晚会。','2003-12-01',0),(254,