及一些汇集国际时尚品牌前沿的商业中心。我就想问，它将在2016年建成，正式运营。我想问您到时会过来体验一把吗？还有假如您在南昌投资，会不会第一选择就是万达城呢？谢谢。\r\n\r\n    姚贝娜：我是特别喜欢玩，尤其你说的海洋馆，还有游乐园这样的地方，电影城。其实对我自己来讲，有很大的吸引力。所以2016年我有时间，一定过来看、一定过来玩。\r\n\r\n   您说的投资，作为万达这样一个品牌，任何有眼光，还有实力的人，一定会想去这样一个投资的计划。所以如果我有实力，一定想。谢谢！\r\n\r\n    主持人：谢谢，刚才姚贝娜团队也做了这个计划，团队做一个好的建议，一定多多关注我们南昌的万达城。','2014-04-03',0),(448,201,'成都城市之音十周年记者会','成都城市之音十周年记者会','2014-04-10',0),(450,201,'2014爱的小桔灯新闻发布会','2014爱的小桔灯新闻发布会','2014-04-15',0),(451,201,'姚贝娜做客《乐视star》','姚贝娜做客《乐视star》http://ent.letv.com/zt/star/index.shtml?ref=index_focus_7','2014-04-17',0),(452,201,'MR网络金曲演唱会','MR网络金曲演唱会','2014-04-18',0),(453,201,'七彩致炫·七城试驾武汉站','七彩致炫·七城试驾武汉站','2014-04-19',0),(454,201,'京东“东乐计划”媒体发布会','京东“东乐计划”媒体发布会','2014-04-21',0),(456,201,'北京爱琴海购物中心《1/2 的我》签售会','北京爱琴海购物中心《1/2 的我》签售会','2014-04-27',0),(457,201,'大型水景秀《白蛇传》首演','大型水景秀《白蛇传》首演','2014-04-28',0),(459,201,'辽宁卫视中国《喜剧力量》助唱嘉宾录制','辽宁卫视中国《喜剧力量》助唱嘉宾录制','2014-05-01',0),(460,201,'中航城-大美上饶群星演唱会','中航城-大美上饶群星演唱会','2014-05-02',0),(461,201,'MusicRadio音乐之声HIGH歌校园行首场北京站暨启动仪式','MusicRadio音乐之声HIGH歌校园行首场北京站暨启动仪式','2014-05-06',0),(462,201,'上海.风尚.志-风尚加州Calibio VIP分享会','风尚加州Calibio VIP分享会','2014-05-08',0),(555,207,'《大戏看北京》甄嬛传专场','','2012-05-19',0),(466,201,'做客中国之声《中国大舞台》','做客中国之声《中国大舞台》','2014-05-18',0),(467,201,'助阵湖北好声音晋级赛','助阵湖北好声音晋级赛','2014-05-24',0),(468,201,'2014香港青年音乐节','2014香港青年音乐节','2014-05-30',0),(469,201,'2014年“六一”晚会《在五彩缤纷的节日里》','2014年“六一”晚会《在五彩缤纷的节日里》','2014-06-01',0),(470,201,'华谊兄弟20周年庆典','华谊兄弟20周年庆典','2014-06-07',0),(471,201,'搜狐视频《世界杯特别报道》开播仪式','搜狐视频《世界杯特别报道》开播仪式','2014-06-09',0),(472,201,'做客《黄焖世界杯》第5期','做客《黄焖世界杯》第5期','2014-06-17',0),(473,201,'泰州海之蓝群星演唱会','泰州海之蓝群星演唱会','2014-06-14',0),(475,201,'爱是最美的风尚明星盛典','爱是最美的风尚明星盛典','2014-06-25',0),(477,201,'星河集团25周年品牌战略发布会','星河集团25周年品牌战略发布会','2014-06-29',0),(478,201,'《我不是明星》','《我不是明星》','2014-06-30',0),(479,201,'百度乐播《世界杯星播客》：姚贝娜带你了解C罗与小贝的不同','百度乐播《世界杯星播客》：姚贝娜带你了解C罗与小贝的不同','2014-07-07',0),(480,201,'明星说公益之姚贝娜','明星说公益之姚贝娜','2014-07-15',0),(481,201,'辽宁卫视《中国喜剧力量》','辽宁卫视《中国喜剧力量》','2014-08-07',0),(482,201,'正荣润璟产品发布会