红河谷》 演唱：香巴拉组合；9、闪闪红星 电影《闪闪红星》插曲 演唱：张一山；10、康巴踢踏舞 表演：海螺沟景区康巴风情园演艺中心；11、洗衣歌 演唱：甘萍；12、沧海一声笑 演唱：耿乐；13、乐琴舞 表演：海螺沟景区新兴乡舞蹈队。','2010-07-06',0),(515,201,'成都全搜索','',NULL,0),(606,208,'金沙北京保利剧场首演','','2005-04-08',0),(516,208,'姚贝娜与沙宝亮在煤矿文工团的演播厅相遇','在开始这篇文字之前我首先要说:下面讲的一切都是实话.如果你真的喜欢他，就和我一起，静静地把这篇文字看完。  \r\n我想我喜欢沙宝应该比在座的大家都要早,因为我喜欢他的时候他还没有红,甚至是一个无名小卒.<暗香>之前,他默默无闻地已经唱了十年的歌.  \r\n从最初听他的《扫落叶的人》，一直到后来的《青春日记》、《爱上一条鱼》、《我的秋天谁来过》，他的声音对我来说是一种享受。奇怪的是，我从来也没有想过要看看他的样子，或者更没想过会见到他的人。  \r\n2000年我上了大学，生活变得丰富起来，有更多的时间听歌，和做喜欢的事情。  \r\n某一年的某一天，我偶然听收音机，一个不太出名的电台，在几乎没有人听的时段，缓缓地主持人和沙宝的声音轻轻在我耳边飘着，还有他的音乐，他的青春日记，他的扫落叶的人。我激动得什么似的。我想，这么好的声音，一定要好好唱歌啊沙宝。  \r\n我们学校附近有一个煤矿文工团的演播厅，是一个摄影棚，很多电视台的综艺节目都是在那个棚里录制的。我们学校的学生经常一群一群地去现场当观众。  \r\n从2001年的元旦开始，我成了那里的常客，只要一有节目录制，我就去棚里看，那时候录制的都是一些省级电视台的类似于《超级访问》的节目，在那里见过很多名人，像孙悦、刘孜、李静、戴军、李冰冰、陶虹、金海心等等等等这些人都是家常便饭，偶尔还会有几个港台的和韩国的明星。  \r\n记得那个时候杨坤还没有红，都是陈琳和他一起登台来给他助威，我就是在那里第一次听他的《无所谓》。  \r\n中央台的《对话》节目也在那里录过，倪萍在开场前给我们讲她的儿子，还挺逗的。  \r\n那个棚本来是规定有开场时间，观众在外面等，当里面的灯光、音响等设备都准备好了，保安打开门，年轻的观众们就一窝蜂地涌进去抢座位。  \r\n但是由于我是常客，一来二去，我和看门的保安就混熟了，于是我就可以早早地进场，在空旷的棚里，找一个角落坐下，看很多帅哥美女在开场前试音，看工作人员忙忙碌碌地布置棚里的东西，我很喜欢那种开场前布置东西的氛围，甚至比录制明星云集的节目现场还要喜欢。  \r\n就是在那一年，也就是2001年的10月（好象是10月，或者是11月，我记得那个时候已经穿上了薄线衣）的某一天，那个棚要录制一期节目，具体是什么节目我忘记了，大概的内容就是一个省级的电视台，请一大堆明星和不太明的星来参加录制，唱歌访问什么的。  \r\n我照常提前进场，搬了把椅子坐在一个角落里看棚里的人走来走去，享受着那种氛围。  \r\n我记得那天我的左边坐了两三个人，也和我一样静静地，看着周围的事情；我的右边，是几个长发的男人在装一些乐器，那是陈琳带来的乐手。  \r\n我正在仔细地看那几个人装那些价值不菲的鼓和吉他，忽然听到左边有个人说：“沙宝，你吃了吗？”  \r\n我一惊，连忙回头。  \r\n我看到左边离我只有两步之距离的那把椅子上，一个穿黑衣服、其貌不扬的男子，用我熟悉的、太熟悉的声音，说：“你们先吃吧，我等会再吃。”  \r\n我的心几乎要跳出来，这就是时常响在我耳边的那个声音，这就是，那个我不知道样子的，默默无闻的，几乎没有人认识的，我太喜欢的那个男人。  \r\n这个时候我坐在他旁边，很近的距离端详着他。  \r\n那个时候的沙宝，真的是没有一点名气，也没有一丝明星的味道，他普通的发型，普通的衬衣和西裤，皮肤黑黑的，不会有人认识他，他坐在那里，就和我一样，像一个普通的观众，注视着空旷的棚子。  \r\n我离开椅子，走过去。  \r\n我说：“你是沙宝吗？我刚才听那个人叫你沙宝。”  \r\n他表情略带吃惊地看着我，说：“是啊。”  \r\n我说：“我经常听你的歌，也很喜欢你的歌。”  \r\n他笑了，看着我，很真诚地说：“谢谢。”  \r\n我说：“不客气，你一定要好好唱歌，你一定会红的。”  \r\n他脸上甚至出现了一丝孩子般的害羞的表情，说：“谢谢你了，你喜欢我的什么歌？”  \r\n我赶紧把我爱听的那几首歌都说了一遍。他又笑了，说：“谢谢你，我会好好唱歌的。”  \r\n看得出来，他也很激动，因为，一个没有名气，甚至相貌平平的歌手，在得到一个宿不相识的人的鼓励时，那种感觉，也许比我这个歌迷在遇到偶像时的心情，还要更快乐一些吧。  \r\n我们那天还聊了一些关于他的歌的内容，只可惜我当时太紧张，当时聊的什么都忘记了，只记得前面的那几句，后面我说了些什么，我自己都不知道了。  \r\n可是我清楚地记得他的笑容，那么明亮，那么朴实，那么真诚，像个快乐的孩子。  \r\n很快观众都陆续进场了，我为了更好地看节目，就去了前排的座位，那个晚上，我心情久久不能平静。前面的节目我几乎都没有看进去，沙宝的声音一直在我耳边飘来飘去。直到沙宝上场，我才慢慢安静下来，静静地看他在台上投入到他的音乐中。他唱的，就是那首《扫落叶的人》。  \r\n那天之后，我一直关注沙宝的各种消息，哪怕他有任何的一点进步，我都高兴万分。  \r\n2003年，沙宝随着那部电视剧，那首《暗香》，他红到每个人的心里，他的歌更加成熟了，他的人也越来越帅气了，只是，5年前的那个朴实无华的不张扬的沙宝，却永远定格在了我的心里。   ','2001-10-01',0),(517,208,'姚贝娜开通新浪博客','http://blog.sina.com.cn/u/1268252377\r\n\r\n我的红色小屋(2006-12-06 01:29)转载▼\r\n今天心情很好，因为交了个新朋友----blog!哈哈哈哈给自己盖了个红色小屋，真暖和！说的什么啊？现在是某日的凌晨一点三十五分，依然没有睡意，脑子却还是糊涂。。。。唉\r\n','2006-12-06',0),(518,201,'DoFaLa三好女声启动仪式','金海心刘沁姚贝娜领军“三好女声”\r\n\r\n\r\n　　信报讯(记者杨博怡) 就在四大选秀激战正酣的时候，一场音乐才女以歌会友的“三好女声”也开始席卷网络。8月16日晚，Do Fa La主办，刘沁、金海心、姚贝娜领军的“三好女声”举行了正式启动仪式，三位女歌手的圈中好友孟军、张亚东、捞仔、沙宝亮、景岗山(blog)等也到场为活动助威。\r\n\r\n　　据网站负责人介绍，本次活动并不是一场选秀，而是以乐会友、以歌过招的一场实\r\n\r\n\r\n力对决。届时，三位掌门人刘沁、金海心、姚贝娜将各自出招，发布自己的最新作品，而网友们则在为歌曲打分的同时，也可以上传自己的作品参与评选。\r\n\r\n　　从现在起，想参与活动的网友都可以在www.dofala.com的声乐琴房中上传自己的作品。最终入选的歌手将有机会成为DoFaLa正式签约歌手，并与“三好女声”一起出唱片。信报记者张越／摄','2006-08-16',0),(520,208,'山东齐鲁电视台粉丝大派送歌友会录制','10月25_26日 深圳 演出 \r\n 10月27日山东 齐鲁电视台<粉丝大派送>歌友会录制 \r\n\r\n另外 ,我是姚贝儿目前的经纪人 陈冬,大家可以叫我冬子,我的联系方式13611396641,吧主和其他歌迷可以与我联系,以后我们每到一个地方都会提前在这个贴吧里面跟大家说明,所到之处的歌迷可以自行组织然后跟我取得联系,我可以安排艺人在不影响工作的时候跟歌迷朋友见面\\聚会等.以上齐鲁电台录制如有当地歌迷想到场助威,请组织同城姚贝儿歌迷,然后跟我联系.欢迎大家到场观看\\助威! \r\n还要感谢一直以来大家对姚贝儿 的支持.贝娜的EP主打歌曲已经开始在全国电台等媒体当中进行播放、打榜，希望大家能够继续多多支持。 \r\n                还有请大家记住：我们是为音乐和你们而存在的！！ \r\n  \r\n                                               冬子 \r\n                                        2007、10、22','2007-10-27',0),(519,208,'深圳演出','10月25_26日 深圳 演出 \r\n \r\n\r\n另外 ,我是姚贝儿目前的经纪人 陈冬,大家可以叫我冬子,我的联系方式13611396641,吧主和其他歌迷可以与我联系,以后我们每到一个地方都会提前在这个贴吧里面跟大家说明,所到之处的歌迷可以自行组织然后跟我取得联系,我可以安排艺人在不影响工作的时候跟歌迷朋友见面\\聚会等.以上齐鲁电台录制如有当地歌迷想到场助威,请组织同城姚贝儿歌迷,然后跟我联系.欢迎大家到场观看\\助威! \r\n还要感谢一直以来大家对姚贝儿 的支持.贝娜的EP主打歌曲已经开始在全国电台等媒体当中进行播放、打榜，希望大家能够继续多多支持。 \r\n                还有请大家记住：我们是为音乐和你们而存在的！！ \r\n  \r\n                                               冬子 \r\n     