演唱一系列充满足球文化的歌曲，为慈善之夜增添爱心氛围。慈善之夜活动将于2007年8月11日在凤凰卫视中文台《凤凰精选》栏目中播出。\r\n（找不到图片）\r\n','2007-08-04',0),(578,208,'第三届中国网络音乐节启动仪式','','2007-08-28',0),(579,207,'“乡村大世界走进木渎”文艺节目','','2007-09-21',0),(580,208,'第九届中韩歌会','','2007-12-07',0),(581,208,'心连心艺术团河南南阳慰问演出','更正地點:河南南阳师鹏、姚贝娜《草根》（心连心赴河南南阳慰问演出）<草根> 與師鵬http://v.yinyuetai.com/playlist/1881273','2007-12-15',0),(582,208,'心艺术团十堰市慰问演出','','2007-12-16',0),(583,208,'2007CCTV综艺盛典录制','','2007-12-28',0),(584,207,'《新视听》：欢声笑语话春晚','','2007-07-25',0),(585,208,'《法在你身边》普法文艺晚会','《法在你身边》普法文艺晚会25日晚首播\r\n本报讯 记者陈丽平\r\n全国普及法律常识办公室近日下发通知，要求各地、各部门组织收看《法在你身边》普法文艺晚会。\r\n\r\n　　据了解，今年“12·4”全国法制宣传日期间，由全国普法办、司法部、中央电视台联合制作的普法文艺晚会———《法在你身边》已制作完成，将于11月25日晚20：00，在中央电视台社会与法频道首播，11月26日中午12：30重播。','2007-11-25',0),(586,207,'《与您相约》大型综艺晚会','','2007-12-01',0),(587,201,'第八届“大红鹰杯”全国青年歌手电视大奖赛','','1998-05-01',0),(588,207,'星际大联盟美少女擂台赛','','2000-06-01',0),(589,208,'庆祝中韩建交十周年两国大学生交流活动','','2002-07-01',0),(590,208,'庆祝申奥成功的全国大学生校园先锋大赛','','2002-09-01',0),(591,207,'BTV－7春节晚会节目录制','','2002-12-01',0),(592,210,'“大红鹰杯”全国青年歌手新人新作比赛','','2003-10-28',0),(593,208,'千心之星大型文艺晚会','','2004-01-05',0),(594,208,'鹏城歌飞扬--2005年度深圳原创歌曲颁奖典礼','','2006-01-20',0),(595,208,'第七届中国蓬莱“和平颂”国际青少年文化艺术盛典“蓬建之夜”闭幕式晚会','','2006-08-24',0),(596,208,'第十二届CCTV青年歌手大奖赛部队获奖选手赴基层慰问演出活动','2006年8月7日—15日，参加总政宣传部组织的第十二届CCTV青年歌手大奖赛部队获奖选手赴基层慰问演出活动。','2006-08-07',0),(597,208,'“秋日情浓，生态广州”文艺晚会','2006年9月24日，参加在广州市体育馆举行，市建委组织的“秋日情浓，生态广州”文艺晚会。演唱《venus》.','2006-09-24',0),(598,208,'“大地飞歌2006”中国-东盟博览会暨南宁国际民歌艺术节开幕晚会文艺晚会','','2006-10-31',0),(599,208,'《活力余姚》演唱会','','2006-11-06',0),(600,208,'河海大学隆重纪念常州校区办学20周年','','2006-11-26',0),(601,201,'《民族魂》—金铁霖、马秋华学生音乐会','','2006-11-28',0),(602,208,'《新视听》元旦特别节 目：欢乐和谐过新年','《新视听》元旦特别节目：欢乐和谐过新年\r\n2006年12月19日 14:09 来源：CCTV.com\r\n2007年,一脸福相的小猪们喜气洋洋地来了。 《新视听》栏目应时应景，为广大电视观众制作了一道连映三天的娱乐大餐，在欢乐和谐的新年伊始，由朱军、管彤、朱迅和马东央视四大主持人领衔，集结演艺界的师徒、父子、夫妻们，各展独门绝活，为新年新气象锦上添花。\r\n1月2日《欢乐和谐之子承父业》\r\n　　主持人：马东、管彤\r\n　　所谓“打虎亲兄弟，上阵父子兵”，潘长江给潘阳《北风吹扎红头绳》(歌剧选段)，姚峰带着姚贝娜擀起了《辣椒面儿》(小品)，而王宝合父子已不甘示弱地耍起了《鬼手》（吴桥杂技）， 宋飞带着父亲和学生一起《赛马》（二胡表演）好不热